import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div classname="app">
      <Routes>
        <Route path="/checkout">
          <h1>checkout</h1>
        </Route>
        <Router path="/login">
          <h1>login page</h1>
        </Router>
        <Route path="/">
          <h1>Home Page</h1>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
